namespace MLC.Wms.Integration.Tests
{
    [TestFixture]
    internal class ArticleLoadTest
    {

        [Test]
        public void Test()
        {

            UnityConfig.RegisterComponents(container =>
            {
                var factory = container.Resolve<ISessionFactory>();

                container.RegisterType<IWmsEnvironmentInfoProvider, SvcWmsEnvironmentInfoProvider>(
                    new ContainerControlledLifetimeManager());
                container.RegisterType<ILocalData, ThreadStaticLocalData>(new ContainerControlledLifetimeManager());
                WmsEnvironment.Init(container.Resolve<IWmsEnvironmentInfoProvider>(), container.Resolve<ILocalData>());

                using (var session = factory.OpenSession())
                {
                    var partnerCode = "IDM";
                    //var partnerCode = "RGL";
                    var queueMessageTypeCode = "IP_LOAD_ART";
                    var testMessage = "Тест загрузки артикулов";


                    var partner = session.Query<WmsMandant>().FirstOrDefault(o => o.PartnerCode == partnerCode);
                    if (partner == null)
                        throw new Exception(string.Format("Отсутствует мандант {0}", partnerCode));
                    var dict = new Dictionary<string, string>();
                    dict.Add("key1", "что-то 1");
                    dict.Add("key2", "что-то 1");
                    var intPar = new Mandant() {PartnerID = 1, PartnerCode = "IDM"};

                    var picture1 = new ArtPicture()
                    {
                        //FileData = Base64Encode("tttttt"),
                        FileData = "",
                        //Description = "проверка загрузки изменения",
                        //Version = "111",
                        Name = "test1",
                    };
                    var picture2 = new ArtPicture()
                    {
                        //FileData = Base64Encode("TTTT"),
                        FileData = "ERROR",
                        //Description = "проверка загрузки",
                        Name = "test2"
                    };

                    var message = new IoQueueIn()
                    {
                        Data = Common.SerializationHelper.SerializeToBytes(new ArticleLoad()
                        {
                            ArtList = new Art[]
                            {
                                new Art()
                                {
                                    //Code = "IDM1",
                                    Name = "1",
                                    ArtPicture = picture1,
                                },
                                new Art()
                                {
                                    //Code = "IDMIDMBLACK",
                                    Name = "IDMBLACK",
                                    ArtPicture = picture2,
                                },
                            },
                            CommandList = dict
                        }),

                        Mandant = partner,
                        Message = testMessage,
                        QueueMessageState = QueueMessageStates.Ready,
                        QueueMessageType =
                            session.Query<IoQueueMessageType>().First(i => i.Code == queueMessageTypeCode)
                    };
                    session.Save(message);
                    using (var transaction = session.BeginTransaction())
                        transaction.Commit();
                }
            });
        }




        private string Base64Encode(string plainText)
        {
            var plainTextBytes = System.Text.Encoding.UTF8.GetBytes(plainText);
            return System.Convert.ToBase64String(plainTextBytes);
        }
    }

}

